style.css:
@-moz-document url-prefix(http://bamboo), url-prefix(https://bamboo) {
.aui-page-header,
.aui-page-panel-content,
.plan-sidebar,
input,
dl,
li.menu-item a,
body {
    color: #F2F2F2 !important;
    background-color: #333 !important
}
h1, h2, th, td,
li.Successful > h3,
li.Failed > h3,
li.NotBuilt > h3 {
    color: #F2F2F2 !important;
    background-color: #333 !important;
}
h3 {
    color: #F2F2F2 !important;
    background-color: #333 !important;
}
#footer-logo {
    filter: invert(100%);
}
.aui-navgroup-horizontal,
ul.ui-droppable,
div.aui-page-panel-nav {
    background-color: #333 !important;
}
li.aui-nav-selected > a,
h2.expanded, h2.collapsed,
#config-sidebar > h2 > a,
div.item-description,
span.plan-branch-name,
span.description {
    color: #F2F2F2 !important;
}
div.code {
    background-color: #333
}
}
